import React, {useState} from 'react';
import Header from '../../Header/Header';
import HomeContentGoals from "./HomeContentGoals";
import HomeContentMedia from "./HomeContentMedia";
import HomeContentLogin from "./HomeContentLogin";
import Footer from '../../Footer/Footer';
import {BrowserRouter, Routes, Route} from "react-router-dom";
import Error404 from "../../Error404";

function Home() {

    return (
            <BrowserRouter>
                <Routes>
                    <Route index element={<Home/>} />
                    <Route path="*" element={<Error404/>} />
            <Header/>
                <HomeContentGoals/>
                <HomeContentMedia/>
                <HomeContentLogin/>
            <Footer/>
                </Routes>
            </BrowserRouter>
    );
}

export default Home;
